Twelve years sine the Isla Sorna incident, Jurassic World has been opened on Isla Nublar. But during that time, guests have become bored with dinosaurs, forcing InGen to create a genetically modified dinosaur known as the Indominus Rex. When the creature escapes, manager Claire Dearing and ethologist Owen Grady, set out to save the park and it’s guests before the Indominus Rex destroys everything. By the time they stop Vic Hoskins and his attempt to weaponize the Indominus Rex and everything dinosaur in the park, they finally come face-to-face with the Indominus Rex. Before they are killed by it, the Tyrannosaurus Rex from the beginning of the park twenty-three years prior, comes to their aid and, with the help of Owen’s trio of velociraptors, kills
the Indominus Rex.
The film, despite being an utter cash grab, is well directed and well acted by it’s star cast. The CGI and special effects are phenomenal, as would be expected from a movie in this franchise. It is unfortunately filled with idiotic characters, who make selfish, morbid, and illogical decisions consistently throughout the flick. And there is a severe lack of attention to detail in Bryce Dallas Howard’s character, who wears high heels in this adventure throughout a dinosaur infested theme park where she has been chased to and fro for hours upon hours. These mistakes are mostly made up for however, by not only being hugely entertaining, but also carrying an ironic moral message about the evils of greed and society’s need and want for more and for their entertainment to be bigger and better, no matter the quality or the ethical ambiguity of it.
All in all, Jurassic World, is an epic film.

